import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Menu from './menu/menu';
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
    <Menu />
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

serviceWorker.unregister();
